import React from 'react';
import './App.css';

function App() {
  const date = new Date()
  return (
    <div className="App">
      <div className="todo">
      <input className="check" type="checkbox"/>
      <p>Lets do some</p>
      </div>

      <div className="todo">
      <input className="check"type="checkbox"/>
      <p>Lets do some</p>
      </div>

      <div className="todo">
      <input className="check"type="checkbox"/>
      <p>Lets do some</p>
      </div>

      <h1>Now your Working Time is {date.getHours() %12} o' clock</h1>


    </div>
  );
}

export default App;
